const BlockType = require('../extension-support/block-type');
const ArgumentType = require('../extension-support/argument-type');

/* eslint-disable-next-line max-len */
const blockIconURI = 'data:image/jpeg;base64,';

/**
 * An example core block implemented using the extension spec.
 * This is not loaded as part of the core blocks in the VM but it is provided
 * and used as part of tests.
 */
class Scratch3CoreExample {
    constructor (runtime) {
        /**
         * The runtime instantiating this block package.
         * @type {Runtime}
         */
        this.runtime = runtime;
    }

    /**
     * @returns {object} metadata for this extension and its blocks.
     */
    getInfo () {
        return {
            id: 'utilCool',
            name: 'Cool Utils', // This string does not need to be translated as this extension is only used as an example.
            blocks: [
                {
                    opcode: 'poopoo',
                    blockType: BlockType.REPORTER,
                    text: 'poo'
                },
                {
                    opcode: 'skbii',
                    blockType: BlockType.COMMAND,
                    text: 'this extension is very useless [CLOCKWISE]',
                    arguments: {
                        CLOCKWISE: {
                            type: ArgumentType.IMAGE,
                            dataURI: blockIconURI
                        }
                    }
                },
                {
                    opcode: 'i_poop',
                    blockType: BlockType.COMMAND,
                    text: 'poo [CLOCKWISE] [CLOCKWISE] [CLOCKWISE]',
                    arguments: {
                        CLOCKWISE: {
                            type: ArgumentType.IMAGE,
                            dataURI: blockIconURI
                        }
                    }
                }
            ]
        };
    }

    /**
     * Example opcode just returns the name of the stage target.
     * @returns {string} The name of the first target in the project.
     */
    poo () {
        const stage = this.runtime.getTargetForStage();
        return stage ? stage.getName() : 'POO IS SMELLY ðŸ¤ª';
    }

    skbii () {
        return;
    }

    i_poop (args, util) {
        window.location.href = "https://www.snail-ide.com/";
    }
}

module.exports = Scratch3CoreExample;
